  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Affordable Care Act includes tools
  to improve the quality of health care that can also lower costs for taxpayers and
  patients.  This means avoiding costly mistakes and readmissions, keeping patients
  healthy, rewarding quality instead of quantity, and building on the health information
  technology infrastructure that enables new payment and delivery models to work.
  \  These reforms and investments will build a health care system that will ensure
  quality care for generations to come.</p>n\",\n\t\"license_title\": \"Other License
